import React from 'react';
import Grid from '@material-ui/core/Grid';
import ExpansionModule from './ExpansionModule';


export default class FilterExpansionModule extends React.Component {
    render() {
        return (
            <div>
                <Grid container item >
                    <Grid container item xs={12} sm={4}>
                        <h2>Filter on:</h2>
                    </Grid>
                    <Grid container xs={12} sm={8} item >
                        <Grid item style={{width:200}}>
                            <ExpansionModule criteria="gender"/>
                        </Grid>
                        <Grid item>
                            <ExpansionModule criteria="team"/>
                        </Grid>
                        <Grid item>
                            <ExpansionModule criteria="class_year"/>
                        </Grid>
                    </Grid>
                </Grid>
            </div>
        );
    }
}
